import { BrowserRouter, Routers, Route } from "react-router-dom";
import LandingPage from "./pages/LandingPage";

function App() {
  return (
    <BrowserRouter>
    <Routers>
      <Route path="/" element={<LandingPage />}/>
    </Routers>
    </BrowserRouter>
  );
}

export default App;
